import React , { Component } from 'react';
import {BrowserRouter, Route, Switch, Link} from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import {Modal, Button} from "bootstrap";
import './App.css';
import Home from "./components/layout/Home";
import Organisations from "./components/layout/Organisations";
import OrganisationsUsers from "./components/layout/OrganisationsUsers";
import Users from "./components/layout/Users";
import Error from "./components/layout/Error";
import Navigation from "./components/layout/Navigation";

class App extends Component {

  render(){ 

    return (
      <BrowserRouter>   
      <Navigation />
      <Switch>
       <Route path="/" component={Home} exact/>
       <Route path="/organisations" component={Organisations} exact />             
       {/* <Route path="/organisationsusers" component={OrganisationsUsers}/> */}
       <Route path="/users" component={Users}/>
       <Route component={Error}/>
      </Switch>
      </BrowserRouter>    

    );
  }

}
export default App;
